import React, {Component} from 'react';
// import moduleName from 'material-ui/styles/';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

class FormInfinitive extends Component {
    continue = (e) => {
        e.preventDefault();
        this.props.nextStep();
    };
    render() {
        return (
            <div>
                <p>Looks like its FormInfinitive</p>
                <Button
                    variant="contained"
                    color="primary"
                    onClick={this.continue}>Continue</Button>
            </div>
        );
    }
}

export default FormInfinitive;
